import { useNavigate } from 'react-router-dom'
import '../../css/auth.css'
import React from 'react'

export const Login = () =>{
    const navigate = useNavigate()
    return (
        <div className='flex panel'>
            <h1>WebShell</h1>
            <label>Логин</label>
            <input className = 'inputAuth' />
            <label>Пароль</label>
            <input className = 'inputAuth'/>
            <button  className='buttonLogin' onClick={()=>{navigate('/console')}}>Отправить </button>
            <button className='buttonRegister' onClick={ () => window.location.href='http://localhost:3000/register'}>Регистрация </button>
        </div>
    );
}
